package forloop;

public class unitdigits {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		  int count = 0;
		  int unitdigitd =0;
			for(int i = 67; i<= 73;i++) {
				unitdigitd = i%10;
				System.out.println(unitdigitd);
				count++;
		     }
	}

	
}
